import React, { useState } from "react";
import Home from "./Home"; // Import your Home component here
import {
  VerticalTimeline,
  VerticalTimelineElement,
} from "react-vertical-timeline-component";
import "react-vertical-timeline-component/style.min.css";
import SchoolIcon from "@material-ui/icons/School";
import WorkIcon from "@material-ui/icons/Work";
import EmojiEventsIcon from "@material-ui/icons/EmojiEvents";
import SportsIcon from "@material-ui/icons/Sports";
import DirectionsRunIcon from "@material-ui/icons/DirectionsRun";
import "../styles/Interact.css";
import profilePicture from "../assets//gradpic2.jpg";
import BGS from "../assets//BGS.jpeg";
import CrossCountry from "../assets//CROSS COUNTRY.jpg";
import experience from "../assets//experence.png";

function Interact() {
  const [showHome, setShowHome] = useState(false);

  const buttonStyle = {
    "--color": "#1e9bff",
    zIndex: 100, // Ensure the button is in front of other elements
  };

  const buttonStyle2 = {
    "--color": "#1FFFD3",
    zIndex: 100, // Ensure the button is in front of other elements
  };

  const handleSnakeGameClick = () => {
    // Handle the click for Snake Game button
    setShowHome(false); // Set showHome to false to hide Home component
  };

  const handleRecipeAppClick = () => {
    // Handle the click for Recipe App button
    setShowHome(true); // Set showHome to true to show Home component
  };

  return (
    <div className="background-container">
      <div className="stars"></div>
      <div className="twinkling"></div>
      <div className="clouds"></div>

      <div className="container">
        <a
          className="button"
          href="#"
          style={buttonStyle}
          onClick={handleSnakeGameClick}
        >
          <span></span>
          <span></span>
          <span></span>
          <span></span>
          Snake Game
        </a>
        <a
          className="button"
          href="#"
          style={buttonStyle2}
          onClick={handleRecipeAppClick}
        >
          <span></span>
          <span></span>
          <span></span>
          <span></span>
          Recipe App
        </a>
      </div>

      {showHome && <Home />} {/* Render Home component if showHome is true */}
    </div>
  );
}

export default Interact;
